from pathlib import Path
from session_insights.parsers import ClaudeParser

def analyze():
    claude_dir = Path.home() / ".claude"
    projects_dir = claude_dir / "projects"
    parser = ClaudeParser()

    empty_files = 0
    has_content_no_messages = 0
    content_samples = []

    for project_dir in projects_dir.iterdir():
        if not project_dir.is_dir():
            continue

        for jsonl_file in project_dir.glob("*.jsonl"):
            try:
                session = parser.parse_session(jsonl_file)
                if session and len(session.messages) == 0:
                    # Check if file is empty
                    file_size = jsonl_file.stat().st_size
                    if file_size == 0:
                        empty_files += 1
                    else:
                        has_content_no_messages += 1
                        if len(content_samples) < 5:
                            with open(jsonl_file) as f:
                                content_samples.append((jsonl_file.name, f.read()[:500]))
            except Exception as e:
                pass

    print(f"Empty files (0 bytes): {empty_files}")
    print(f"Has content but 0 messages: {has_content_no_messages}")

    if content_samples:
        print(f"\nSample content from files with no messages:")
        for name, content in content_samples:
            print(f"\n--- {name} ---")
            print(content[:300])

if __name__ == "__main__":
    analyze()
